void StudioSetRemapColors(int top, int bottom)
{
	cl_entity_s* ent = IEngineStudioAPI.GetCurrentEntity();
	if (g_Vars.LocalCheck)
	{
		GetHitboxes(ent);
		SetRemapColors(ent);
	}
	if (ent && ent->player && ent->index != -1 && g_Vars.LocalCheck)
	{
		if (ent->index != g_Local.ent->index && IsValidEnt(ent))
		{
			for (int i = 1; i <= 12; ++i)
			{
				Vector vBBMin, vBBMax, vVel;

				model_t* pModel;
				studiohdr_t* pStudioHeader;
				BoneMatrix_t* pBoneMatrix;
				mstudiobbox_t* pHitbox;

				pModel = IEngineStudioAPI.SetupPlayerModel(ent->index);
				pStudioHeader = (studiohdr_t*)IEngineStudioAPI.Mod_Extradata(pModel);
				pBoneMatrix = (BoneMatrix_t*)IEngineStudioAPI.StudioGetBoneTransform();
				pHitbox = (mstudiobbox_t*)((byte*)pStudioHeader + pStudioHeader->hitboxindex);

				VectorTransform(pHitbox[i].bbmin, (*pBoneMatrix)[pHitbox[i].bone], vBBMin);
				VectorTransform(pHitbox[i].bbmax, (*pBoneMatrix)[pHitbox[i].bone], vBBMax);
				g_HitBox[ent->index].pHitBox[i] = (vBBMax + vBBMin) * 0.5f;
				//g_LocalPlayer[ent->index].Hitbox[i] = (vBBMax + vBBMin) * 0.5f;
			}
		}
	}
	return IEngineStudioAPI.StudioSetRemapColors(top, bottom);
}

void MyVectorTransform(QVector in1, float in2[3][4], float* out, int xyz, float multi)
{
	in1[xyz] *= multi;

	out[0] = in1.Dot(in2[0]) + in2[0][3];
	out[1] = in1.Dot(in2[1]) + in2[1][3];
	out[2] = in1.Dot(in2[2]) + in2[2][3];
}

void GetHitboxes(struct cl_entity_s* ent)
{
	if (ent && ent->player && ent->index != -1 && ent->index != g_Local.ent->index && IsValidEnt(ent))
	{
		QVector vBBMin, vBBMax, vTransform, vMultiPoint;

		model_t* pModel = IEngineStudioAPI.SetupPlayerModel(ent->index);
		if (pModel == NULL)
			return;

		studiohdr_t* pStudioHeader = (studiohdr_t*)IEngineStudioAPI.Mod_Extradata(pModel);
		BoneMatrix_t* pBoneMatrix = (BoneMatrix_t*)IEngineStudioAPI.StudioGetBoneTransform();
		mstudiobbox_t* pHitbox = (mstudiobbox_t*)((byte*)pStudioHeader + pStudioHeader->hitboxindex);

		g_Local.iMaxHitboxes = pStudioHeader->numhitboxes - 1;
		g_HitBox[ent->index].iMaxHitboxes = pStudioHeader->numhitboxes - 1;
		for (unsigned int i = 0; i < pStudioHeader->numhitboxes; i++)
		{
			VectorTransform(pHitbox[i].bbmin, (*pBoneMatrix)[pHitbox[i].bone], vBBMin);
			VectorTransform(pHitbox[i].bbmax, (*pBoneMatrix)[pHitbox[i].bone], vBBMax);
			g_HitBox[ent->index].vHitboxMin[i] = vBBMin;
			g_HitBox[ent->index].vHitboxMax[i] = vBBMax;
			g_HitBox[ent->index].vHitbox[i] = (vBBMax + vBBMin) * 0.5f + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;

			g_HitBox[ent->index].fHitboxFOV[i] = g_Local.vForward.AngleBetween(g_HitBox[ent->index].vHitbox[i] - g_Local.vEye);
			g_HitBox[ent->index].vOriginFOV = g_Local.vForward.AngleBetween((QVector)ent->origin - g_Local.vEye);
			g_HitBox[ent->index].vHitboxPoints[i][0] = vBBMax + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
			g_HitBox[ent->index].vHitboxPoints[i][1] = vBBMin + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;

			vMultiPoint[0] = pHitbox[i].bbmin[0] / pHitbox[i].bbmax[0];
			vMultiPoint[1] = pHitbox[i].bbmin[1] / pHitbox[i].bbmax[1];
			vMultiPoint[2] = pHitbox[i].bbmin[2] / pHitbox[i].bbmax[2];

			MyVectorTransform((QVector)pHitbox[i].bbmax, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 0, vMultiPoint[0]);
			g_HitBox[ent->index].vHitboxPoints[i][2] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
			MyVectorTransform((QVector)pHitbox[i].bbmax, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 1, vMultiPoint[1]);
			g_HitBox[ent->index].vHitboxPoints[i][3] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
			MyVectorTransform((QVector)pHitbox[i].bbmax, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 2, vMultiPoint[2]);
			g_HitBox[ent->index].vHitboxPoints[i][4] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;

			vMultiPoint[0] = pHitbox[i].bbmax[0] / pHitbox[i].bbmin[0];
			vMultiPoint[1] = pHitbox[i].bbmax[1] / pHitbox[i].bbmin[1];
			vMultiPoint[2] = pHitbox[i].bbmax[2] / pHitbox[i].bbmin[2];

			MyVectorTransform((QVector)pHitbox[i].bbmin, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 0, vMultiPoint[0]);
			g_HitBox[ent->index].vHitboxPoints[i][5] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
			MyVectorTransform((QVector)pHitbox[i].bbmin, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 1, vMultiPoint[1]);
			g_HitBox[ent->index].vHitboxPoints[i][6] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
			MyVectorTransform((QVector)pHitbox[i].bbmin, (*pBoneMatrix)[pHitbox[i].bone], vTransform, 2, vMultiPoint[2]);
			g_HitBox[ent->index].vHitboxPoints[i][7] = vTransform + g_LocalPlayer[ent->index].vVelocity * g_LocalPlayer[ent->index].flFrametime;
		}
	}
}

void StudioSetupLighting(struct alight_s* plighting)
{
	cl_entity_s* ent = IEngineStudioAPI.GetCurrentEntity();

	if (ent->player && g_Vars.PlayerGlow) plighting->ambientlight = 192;

	return IEngineStudioAPI.StudioSetupLighting(plighting);
}

void SetRemapColors(struct cl_entity_s* ent)
{
	bool canDraw = false;
	canDraw  = IsCanDraw(ent->index, g_Vars.ModelSelection);
	if (ent && ent->model && ent->model->name && ent->player && IsValidEnt(ent))
	{
		studiohdr_t* pStudioHeader = (studiohdr_t*)IEngineStudioAPI.Mod_Extradata(ent->model);
		mstudiobbox_t* pHitbox = (mstudiobbox_t*)((byte*)pStudioHeader + pStudioHeader->hitboxindex);
		mstudiobone_t* pbones = (mstudiobone_t*)((byte*)pStudioHeader + pStudioHeader->boneindex);
		BoneMatrix_t* pBoneMatrix = (BoneMatrix_t*)IEngineStudioAPI.StudioGetBoneTransform();
		if (ent && ent->model && ent->model->name && ent->player && IsValidEnt(ent) && g_Vars.DrawHitBox && ent->index != g_Local.ent->index && (canDraw))
		{
			for (int i = 0; i < pStudioHeader->numhitboxes; i++)
			{
				Vector vCubePointsTrans[8], vCubePoints[8];

				vCubePoints[0] = Vector(pHitbox[i].bbmin.x, pHitbox[i].bbmin.y, pHitbox[i].bbmin.z);
				vCubePoints[1] = Vector(pHitbox[i].bbmin.x, pHitbox[i].bbmax.y, pHitbox[i].bbmin.z);
				vCubePoints[2] = Vector(pHitbox[i].bbmax.x, pHitbox[i].bbmax.y, pHitbox[i].bbmin.z);
				vCubePoints[3] = Vector(pHitbox[i].bbmax.x, pHitbox[i].bbmin.y, pHitbox[i].bbmin.z);
				vCubePoints[4] = Vector(pHitbox[i].bbmax.x, pHitbox[i].bbmax.y, pHitbox[i].bbmax.z);
				vCubePoints[5] = Vector(pHitbox[i].bbmin.x, pHitbox[i].bbmax.y, pHitbox[i].bbmax.z);
				vCubePoints[6] = Vector(pHitbox[i].bbmin.x, pHitbox[i].bbmin.y, pHitbox[i].bbmax.z);
				vCubePoints[7] = Vector(pHitbox[i].bbmax.x, pHitbox[i].bbmin.y, pHitbox[i].bbmax.z);

				for (unsigned int x = 0; x < 8; x++)
					VectorTransform(vCubePoints[x], (*pBoneMatrix)[pHitbox[i].bone], vCubePointsTrans[x]);

				glDisable(GL_TEXTURE_2D);
				glLineWidth(1);
				glColor4f(g_Vars.color_red, g_Vars.color_green, g_Vars.color_blue, 1.f);
				for (unsigned int x = 0; x < 12; x++)
				{
					glBegin(GL_LINES);
					glVertex3fv(vCubePointsTrans[SkeletonHitboxMatrix[x][0]]);
					glVertex3fv(vCubePointsTrans[SkeletonHitboxMatrix[x][1]]);
					glEnd();
				}
				glEnable(GL_TEXTURE_2D);
			}
		}
	}
	canDraw = false;
}
